// default to song 1
const byte* music_ptr = music1;

byte next_music_byte() {
  return *music_ptr++;
}

void play_music() {
  static byte chs = 0;
  if (music_ptr) {
    // run out duration timer yet?
    while (cur_duration == 0) {
      // fetch next byte in score
      byte note = next_music_byte();
      // is this a note?
      if ((note & 0x80) == 0) {
        // pulse plays higher notes, triangle for lower if it's free
        if (note+transpose >= BASS_NOTE || (chs & 4)) {
          int period = NOTE_TABLE[note+transpose & 63];
          // see which pulse generator is free
          if (!(chs & 1)) {
            if (duty1 == 0) {
            APU_PULSE_DECAY(0, period, DUTY_12, length1, initvol1);
            }
            if (duty1 == 1) {
            APU_PULSE_DECAY(0, period, DUTY_25, length1, initvol1);
            }
            if (duty1 == 2) {
            APU_PULSE_DECAY(0, period, DUTY_50, length1, initvol1);
            }
            if (duty1 == 3) {
            APU_PULSE_DECAY(0, period, DUTY_75, length1, initvol1);
            }
            if (noise_channel[music_index] == 0) {
            APU_NOISE_DECAY(30, 2, 10);
            noipos = 7;
            }
            sq1pos = 7;
            chs |= 1;
          } else if (!(chs & 2)) {
            if (duty2 == 0) {
            APU_PULSE_DECAY(1, period, DUTY_12, length2, initvol2);
            }
            if (duty2 == 1) {
            APU_PULSE_DECAY(1, period, DUTY_25, length2, initvol2);
            }
            if (duty2 == 2) {
            APU_PULSE_DECAY(1, period, DUTY_50, length2, initvol2);
            }
            if (duty2 == 3) {
            APU_PULSE_DECAY(1, period, DUTY_75, length2, initvol2);
            }
            if (noise_channel[music_index] == 1) {
            APU_NOISE_DECAY(30, 2, 10);
            noipos = 7;
            }
            sq2pos = 7;
            chs |= 2;
          }
        } else {
          int period = note_table_tri[note+transpose & 63];
          APU_TRIANGLE_LENGTH(period, lengthtri);
          if (noise_channel[music_index] == 2) {
          APU_NOISE_DECAY(30, 2, 10);
          noipos = 7;
          }
          tripos = 7;
          chs |= 4;
        }
      } else {
        // end of score marker
        if (note == 0xff)
          music_ptr = NULL;
        // set duration until next note
        cur_duration = note & 63;
        // reset channel used mask
        chs = 0;
      }
    }
    cur_duration--;
  }
}

void put_str(unsigned int adr, const char *str) {
  vram_adr(adr);        // set PPU read/write address
  vram_write(str, strlen(str)); // write bytes to PPU
}

void put_title(int song) {
  ppu_off();
  put_str(NTADR_A(4,25), "                           ");
  put_str(NTADR_A(4,26), "                           ");
  put_str(NTADR_A(2,25), song_symbol);
  put_str(NTADR_A(2,26), artist_symbol);
  put_str(NTADR_A(4,25), name_tables[song]);
  put_str(NTADR_A(4,26), artist_tables[song]);
  ppu_on_all();
}


void start_music(const byte* music) {
  //apply the preset
  transpose = transpose_table[music_index];
  duty1 = duty1_table[music_index];
  duty2 = duty2_table[music_index];
  length1 = length1_table[music_index];
  length2 = length2_table[music_index];
  lengthtri = lengthtri_table[music_index];
  initvol1 = initvol1_table[music_index];
  initvol2 = initvol2_table[music_index];
  
  //reset the APU
  APU_PULSE_DECAY(0, 0, DUTY_12, 0, 0);
  APU_PULSE_DECAY(1, 0, DUTY_12, 0, 0);
  APU_TRIANGLE_LENGTH(0, 0);
  APU_NOISE_DECAY(0, 0, 0);
  
  //put the song title on screen
  put_title(music_index);
  
  //then play the track
  playing_track = music_index;
  music_ptr = music;
  cur_duration = 0;
}

